    return iot("DELETE", "/jobs/$(jobId)"; aws_config=aws_config)
end
function delete_job(
    jobId, params::AbstractDict{String}; aws_config::AbstractAWSConfig=global_aws_config()
)
    return iot("DELETE", "/jobs/$(jobId)", params; aws_config=aws_config)
end

